import React from "react";
import logo from "./logo.svg";
import "./styles/style.css";
import { Router, Route, Switch } from "react-router-dom";
import Navbar from "./components/navbar";

function App() {
  return (
    <div className="App">
      <Navbar></Navbar>
      <Router history={history}>
        <Switch>
          <Route
            exact
            path="/"
            component={() => <LandingPage size={size}></LandingPage>}
          />
          <Route exact path="/rooms" component={Rooms} />
          <Route exact path="/create-room" component={CreatorSpace} />
          <Route exact path="/mobile" component={MobileRoom} />
          <Route
            exact
            path="/room/:title"
            component={size[0] < 900 || size[1] < 900 ? MobileRoom : Room}
          />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
